Principal Secretary Culture, Sh. Suresh Kumar Gupta, chaired a mega public darbar at Manasbal Park, Ganderbal, where locals from various areas, including Safapora and Kundabal, voiced their concerns on issues like road widening, bridge completion, fire services, and educational and health facilities. The Principal Secretary assured that unresolved issues would be escalated for prompt resolution. Deputy Commissioner Ganderbal,Sh. Shyambir, provided updates on various concerns and directed the development of a plan for Manasbal Lake's preservation. A Tiranga rally was flagged off by the Principal Secretary, who also led a Swachhta pledge, initiated a plantation drive, and witnessed cultural performances. Sanction letters and cheques under Mission Youth and the Higher Education Assistance Scheme were distributed to beneficiaries, highlighting the administration's commitment to supporting the local community. The event was attended by additional district officers and a large public gathering.
